import React from "react";
import { useAuth } from "../context/AuthContext";
import UserProfile from "./userprofile.widget";
import UserList from "./userList";
import WeatherWidget from "./weather.widget";
import Stocks from "./stock.widget";
import Quotes from "./quotes.widget";
import Calculator from "./Calculator";
// import Checklist from "./Checklist"; // Uncomment if you want to use this widget
import Sidebar from "./sidebar.component"; // Import the Sidebar
import "../styles/dashboard.css";

const Dashboard = () => {
    const { currentUser } = useAuth();

    return (
        <div className="dashboard">
            <Sidebar /> {/* Add the Sidebar component */}
            <div className="widgets">

                <UserProfile />
                <UserList />
                <WeatherWidget />
                <Stocks />
                <Quotes />
                <Calculator />
                {/* <Checklist /> */}
                {/* Add more widgets here if needed */}
            </div>
        </div>
    );
};

export default Dashboard;
